import React from 'react';
import seedImage from '../images/progress/seed.png';
import saplingImage from '../images/progress/sapling.png';
import youngTreeImage from '../images/progress/young_tree.png';
import treeImage from '../images/progress/tree.png';
import '../styles/progressTree.css';

const ProgressTree = ({ habitStage }) => {
    const stages = [
        { image: seedImage, label: "Semilla" },
        { image: saplingImage, label: "Brote" },
        { image: youngTreeImage, label: "Árbol joven" },
        { image: treeImage, label: "Árbol completo" },
    ];

    return (
        <div className="progress-tree">
            {stages.slice(0, habitStage + 1).map((stage, index) => (
                <div key={index} className="tree-stage">
                    <img src={stage.image} alt={stage.label} className="tree-image" />
                    <p>{stage.label}</p>
                </div>
            ))}
        </div>
    );
};

export default ProgressTree;
